import React from 'react'
import '../Style/ProductCard.css'

const ProductCard = ({name,price,image,index}) => {
  return (
    <div className='ProductCard'>
        <img src={image} alt={`${index} product`}/>
        <p>{name}</p>
        <span>{price}</span>
    </div>
  )
}

export default ProductCard
